import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="gray-background">
      <img src={logo} alt="logo" />
      <h2>Appdoc Project & Developer recommendation system</h2>
    </div>
  );
}

export default App;
